const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    {/* <App /> */}
    <StarRating maxRating={5} />
    <StarRating
      maxRating={5}
      color="red"
      size={45}
      messages={["poor", "bad", "neutral", "happy", "Excellent"]}
      default={3}
    />
  </React.StrictMode>
);
